# Parse the HTML with BeautifulSoup
soup = BeautifulSoup(html_data, "html.parser")

# Find all `li` elements (in case there are multiple entries in the full HTML)
data = []

for li in soup.find_all("li", style="display:inline-block;"):
    # Extract the image URL
    img_tag = li.find("img", class_="thumbimage")
    image_url = img_tag["src"] if img_tag else None

    # Extract the ID and Model from the caption
    caption = li.find("div", class_="thumbcaption")
    if caption:
        id_text = caption.find("b", string="ID")
        model_text = caption.find("b", string="Model")
        skin_id = id_text.next_sibling.strip(": ").strip() if id_text else None
        model = model_text.next_sibling.strip(": ").strip() if model_text else None
    else:
        skin_id, model = None, None

    # Append to the data list as a dictionary
    data.append({
        "Image URL": image_url,
        "ID": int(skin_id) if skin_id else None,
        "Model": model
    })

# Convert the data to JSON format and save to a file
with open("output.json", "w") as json_file:
    json.dump(data, json_file, indent=4)

print("Data has been written to output.json")